    "long-lake-wetland-management-district-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Long Lake
    WMD and the easement refuges outlines Refuge accomplishments during the 1984 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, grazing, haying, fire management, pest control, water rights, and WPA
    easements. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, animal control, and disease control. The public
    uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment replacement, communication systems, and
    energy conservation. Cooperative programs and items of interest are provided at
    the end. Refuge brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
